function ConceptItem(props) {
    const classes = 'concept ' + props.className

    return  (
    <li className={classes}>
        <img src={props.image} alt={props.title} />
        <h2>{props.title}</h2>
        <p>{props.description}</p>
    </li>
    )
}

export default ConceptItem;
